@MainActor func transient_ArtworkFileGenerationParameters_hasNoData (
       _ self_mArtwork_layerConfiguration : LayerConfiguration?,     
       _ self_drawBoardLimits : Bool,                                
       _ self_drawInternalBoardLimits : Bool,                        
       _ self_drawComponentNamesTopSide : Bool,                      
       _ self_drawComponentNamesBottomSide : Bool,                   
       _ self_drawComponentValuesTopSide : Bool,                     
       _ self_drawComponentValuesBottomSide : Bool,                  
       _ self_drawPackageLegendTopSide : Bool,                       
       _ self_drawPackageLegendBottomSide : Bool,                    
       _ self_drawPadHolesInPDF : Bool,                              
       _ self_drawPadsTopSide : Bool,                                
       _ self_drawPadsBottomSide : Bool,                             
       _ self_drawTextsLayoutTopSide : Bool,                         
       _ self_drawTextsLayoutBottomSide : Bool,                      
       _ self_drawTextsLegendTopSide : Bool,                         
       _ self_drawTextsLegendBottomSide : Bool,                      
       _ self_drawTracksTopSide : Bool,                              
       _ self_drawTracksInner1Layer : Bool,                          
       _ self_drawTracksInner2Layer : Bool,                          
       _ self_drawTracksInner3Layer : Bool,                          
       _ self_drawTracksInner4Layer : Bool,                          
       _ self_drawTracksBottomSide : Bool,                           
       _ self_drawTraversingPads : Bool,                             
       _ self_drawVias : Bool
) -> Bool {
//--- START OF USER ZONE 2
        var hasNoData = true
        if let layerConfiguration = self_mArtwork_layerConfiguration {
          switch layerConfiguration {
          case .twoLayers :
            ()
          case .fourLayers :
            hasNoData = !self_drawTraversingPads
                     && !self_drawTracksInner1Layer && !self_drawTracksInner2Layer
          case .sixLayers :
            hasNoData = !self_drawTraversingPads
                     && !self_drawTracksInner1Layer && !self_drawTracksInner2Layer
                     && !self_drawTracksInner3Layer && !self_drawTracksInner4Layer
          }
        }
        return
          hasNoData &&
          !self_drawBoardLimits &&
          !self_drawInternalBoardLimits &&
          !self_drawComponentNamesTopSide &&
          !self_drawComponentNamesBottomSide &&
          !self_drawComponentValuesTopSide &&
          !self_drawComponentValuesBottomSide &&
          !self_drawPackageLegendTopSide &&
          !self_drawPackageLegendBottomSide &&
          !self_drawPadHolesInPDF &&
          !self_drawPadsTopSide &&
          !self_drawPadsBottomSide &&
          !self_drawTextsLayoutTopSide &&
          !self_drawTextsLayoutBottomSide &&
          !self_drawTextsLegendTopSide &&
          !self_drawTextsLegendBottomSide &&
          !self_drawTracksTopSide &&
          !self_drawTracksBottomSide &&
          !self_drawVias
//--- END OF USER ZONE 2
}

